<template>
    <section class="my-10">
        <div class="grid grid-cols-1 sm:grid-cols-1 md:grid-cols-2 gap-10">
            <div class="py-3">
                <Heading label="These are my skills"/>
                <Subheading label="Basically, Problem Solving and Innovation"/>
                <p class="mt-3 mb-2" data-aos="fade-up" data-aos-duration="1700">
                    I enjoy solving real problems  whether that means improving how a website feels, making a process faster, 
                    or helping a business work more efficiently through technology. 
                    I care about clarity, performance, and long-term maintainability, not just how things look on day one.
                </p>
                <p data-aos="fade-up" data-aos-duration="1900">
                    My work focuses on building systems that are simple for people to use and dependable behind the scenes.
                    From concept to launch, I approach every project with a practical mindset: 
                    understand the goal, build thoughtfully, and deliver something that genuinely works.
                </p>
                <div class="my-10">
                    <Socials />
                </div>
            </div>
            <div class="grid grid-cols-1 sm:grid-cols-1 md:grid-cols-2 lg:grid-cols-2 gap-10 mb-10">
